import styled from "styled-components";

export const AddProductButton = styled.button`

  background-color: #4CAF50; 
  border: none;
  color: white;
  padding: 7.5px 16px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
  margin: 10px;
`;
